public class Line
{
	private Point start;
	private Point end;

	public Line(Point start, Point end)
	{
		this.start = start;
		this.end = end;
	}

	public String toString()
	{
		return "[" + start + ", " + end + "]";
	}
}

class Point
{
	private int x;
	private int y;

	public Point(int x, int y)
	{
		this.x = x;
		this.y = y;
	}

	public String toString()
	{
		return "(" + x + ", " + y + ")";
	}
}
